<!DOCTYPE html>
<html>
<head>
  <style>
    #myFrame {
      width: 100%;
      height: 1000px;
      border: 0;
    }
  </style>
  <script>
    function hideElementsInIframe() {
      var iframe = document.getElementById('myFrame');
      var customCss = `
        .privacy-link, .app-name, .fullscreen-icon {
          display: none !important;
        }
      `;
      var iframeContent = iframe.contentWindow.document;
      var styleElement = iframeContent.createElement('style');
      styleElement.innerHTML = customCss;
      iframeContent.head.appendChild(styleElement);
    }
  </script>
</head>
<body onload="hideElementsInIframe()">
  <iframe id="myFrame" src="https://lookerstudio.google.com/embed/reporting/d143bc60-95c4-4fe4-807f-ae07acc9e310/page/MslUD"></iframe>
</body>
</html>
